from itertools import permutations

def is_prime(n):
    if n >= 1:
        for i in range(2, n):
            if n % i == 0:
                return False
        else:
            return True
    else:
        return False

def array_to_sequence(arr):
    for seq in permutations(arr):
        prime_sum = True
        for i in range(len(seq) - 1):
            if not is_prime(seq[i] + seq[i + 1]):
                prime_sum = False
                break
        if prime_sum:
            return list(seq)
    return []

